let setGoPlayAction = function (i) {
    document.body.addEventListener('click', cl, false);
    document.body.addEventListener('touchstart', cl, false);
    document.body.addEventListener('touchmove', cl, false);
    function cl() {
        if (i.isNotPlayed && i.musicPlayer) {
            try {
                i.musicPlayer.play().catch(function (e) {
                });
            } catch (e) {
            }
        } else {
            document.body.removeEventListener('click', cl, false);
            document.body.removeEventListener('touchstart', cl, false);
            document.body.removeEventListener('touchmove', cl, false);
        }
    };
    document.body.click();
};
let setTouch = function (onode, upfn, downfn, s, deg, t, ds) {
    var x, y;
    s = Math.abs(Number(s) ? Number(s) : 45);
    deg = Boolean(deg);
    t = Math.abs(Number(t) ? Number(t) : 45);
    ds = Boolean(ds);
    upDateFn();
    function startFn(e) {
        e = e || window.event;
        x = e.touches[0].pageX;
        y = e.touches[0].pageY;
    };
    function endFn(e) {
        e = e || window.event;
        let ex = e.changedTouches[0].pageX;
        let ey = e.changedTouches[0].pageY;
        let dx = x - ex;
        let dy = y - ey;
        let angle = 360 * Math.atan(Math.abs(dy) / Math.abs(dx)) / (2 * Math.PI);
        let isYes = deg ? (angle > s) : (Math.abs(dy) > s);
        let isDYes = ds ? (angle > t) : (Math.abs(dy) > t);
        if (dy > 0 && isYes && isDYes) {
            typeof downfn === 'function' && upfn();
        } else if (dy < 0 && isYes && isDYes) {
            typeof downfn === 'function' && downfn();
        } else {
            // e.preventDefault();
            // console.log('操作范围太小');
        }
    };
    function destroyFn() {
        if (onode !== document.body) {
            document.body.ontouchmove = null;
        }
        onode.removeEventListener('touchstart', startFn, false);
        onode.removeEventListener('touchend', endFn, false);
    };
    function upDateFn() {
        if (onode !== document.body) {
            document.body.ontouchmove = function (e) {
                e = e || window.event;
                e.preventDefault();
                return;
            };
        }
        if (onode) {
            onode.addEventListener('touchstart', startFn, false);
            onode.addEventListener('touchend', endFn, false);
        }
    }
    return {
        destroy: destroyFn,
        setTouch: function () {
            this.destroy();
            upDateFn();
        }
    };
};
